import React from 'react';

function About() {
  return (
    <div className="section">
      <h2>About Me</h2>
      <p>Hello! I am a web developer passionate about building React apps.</p>
      <p>I am a passionate web developer currently pursuing my degree Bachelor of Science (Vocational) Information Technology from St. Xavier College Ranchi. I Love to learn building creative and responsive web interfaces.
      </p>
      <h2>**What I Learn**</h2>
      <ul>
        <li>HTML</li>
        <li>CSS</li>
        <li>JavaScript</li>
        <li>React.js</li>
      </ul>
      <p>This is part of my Minor Project for InternsVeda and showcase my skills,Project and contact information</p>
    </div>
  );
}

export default About;
